import React from "react";

class SeacrBar extends React.Component {
  render() {
    return (
      <form className="ui form">
        <div className="field">
          <label>YouTube Videos</label>
          <input type="text" onSubmit={this.onFormSubmit}></input>
        </div>
      </form>
    );
  }
}

export default SeacrBar;
